import React, {useContext} from 'react';
import { GlobalContext } from '../context/GlobalState';
export const StartLevel = ({ startlevel }) => {
    return (
        <>
            <h4>Your Initial Glucose Level</h4>
            <h1>{startlevel.level}mmol/L</h1>
        </>
    )
}
